script: |
  super -f text -I q5821.spq | sort > q5821.out

inputs:
  - name: q5821.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT ( 57 ) BETWEEN col1 * - ( col1 ) + + 57 * col0 AND col2 * col0;
  - name: tab0

outputs:
  - name: q5821.out
    data: |
      87	21	10
      97	1	99
